import React from 'react';
import opggLogo from 'opgg-logo.png';

class OPGGButton extends React.Component{
    render(){
        return(
          <button><img src={opggLogo} alt="OP.GG Logo" onClick={this.myfunction} /></button>
        );
      }
}

export default OPGGButton;
